const e=JSON.parse('{"key":"v-4b2c51ba","path":"/pentest/priv/","title":"权限提升","lang":"zh-CN","frontmatter":{"description":"什么是权限提升 权限提升是指将当前进程的权限提高到更高的级别，这样可以执行一些普通用户无法执行的操作。在Linux中，可以使用sudo命令来提升权限，需要输入管理员密码。在Windows中，可以右键以管理员身份运行程序或使用UAC（用户账户控制）来提升权限。 如何提权 搜索现有的提权脚本，程式进行提权。","head":[["meta",{"property":"og:url","content":"https://deelmind.com/pentest/priv/"}],["meta",{"property":"og:site_name","content":"極客方舟"}],["meta",{"property":"og:title","content":"权限提升"}],["meta",{"property":"og:description","content":"什么是权限提升 权限提升是指将当前进程的权限提高到更高的级别，这样可以执行一些普通用户无法执行的操作。在Linux中，可以使用sudo命令来提升权限，需要输入管理员密码。在Windows中，可以右键以管理员身份运行程序或使用UAC（用户账户控制）来提升权限。 如何提权 搜索现有的提权脚本，程式进行提权。"}],["meta",{"property":"og:type","content":"article"}],["meta",{"property":"og:locale","content":"zh-CN"}],["script",{"type":"application/ld+json"},"{\\"@context\\":\\"https://schema.org\\",\\"@type\\":\\"Article\\",\\"headline\\":\\"权限提升\\",\\"image\\":[\\"\\"],\\"dateModified\\":null,\\"author\\":[]}"]]},"headers":[{"level":2,"title":"什么是权限提升","slug":"什么是权限提升","link":"#什么是权限提升","children":[]},{"level":2,"title":"如何提权","slug":"如何提权","link":"#如何提权","children":[]}],"git":{"createdTime":null,"updatedTime":null,"contributors":[]},"readingTime":{"minutes":0.42,"words":127},"filePathRelative":"pentest/priv/README.md","copyright":{},"autoDesc":true,"excerpt":""}');export{e as data};
